INSERT INTO `VIEWS` VALUES(NULL, 'MiscAndrew', 'current_command_user', '/* ALGORITHM=UNDEFINED */ select `MiscAndrew`.`user`.`username` AS `username` from `MiscAndrew`.`user` where `MiscAndrew`.`user`.`uid` in (select `MiscAndrew`.`use`.`userID` AS `userID` from `MiscAndrew`.`use` where `MiscAndrew`.`use`.`commandID` in (select `recent_command`.`command` AS `command` from `MiscAndrew`.`recent_command`))', 'NONE', 'YES', 'MiscAndrew@%', 'DEFINER');
INSERT INTO `VIEWS` VALUES(NULL, 'MiscAndrew', 'last_use', '/* ALGORITHM=UNDEFINED */ select `MiscAndrew`.`use`.`userID` AS `userID`,`MiscAndrew`.`use`.`time` AS `time`,`MiscAndrew`.`use`.`commandID` AS `commandID`,`MiscAndrew`.`use`.`completed` AS `completed` from `MiscAndrew`.`use` where `MiscAndrew`.`use`.`commandID` in (select max(`MiscAndrew`.`use`.`commandID`) AS `MAX(``commandID``)` from `MiscAndrew`.`use` where (`MiscAndrew`.`use`.`completed` = 1))', 'NONE', 'YES', 'MiscAndrew@%', 'DEFINER');
INSERT INTO `VIEWS` VALUES(NULL, 'MiscAndrew', 'recent_command', '/* ALGORITHM=UNDEFINED */ select `MiscAndrew`.`command`.`commandText` AS `commandText`,min(`MiscAndrew`.`command`.`commandID`) AS `command` from `MiscAndrew`.`command`', 'NONE', 'NO', 'MiscAndrew@%', 'DEFINER');
